import DashboardSidebar from "./sidebar";

const DashboardLayout = (props)=>{
  const [isOpen, setIsOpen] = useState
  return(
    <Wrapper>
      <DashboardSidebar target={props.target}/>
      <MainWrapper>
        <DashboardHeader/>
        <Main>
          {props.children}
        </Main>
        <DashboardFooter/>
      </MainWrapper>
    </Wrapper>
  );
}

export default DashboardLayout;
